  false,\n\t\"url\": null,\n\t\"notes\": \"These data present a ground-water inventory
  of existing geospatial data and other information needed to determine the extent
  and characteristics of the aquifers in the Tahoe Basin. Geospatial and other data
  include well information from various local, state, and federal agencies; geophysical
  surveys; and results of available ground-water and geological studies. The compilation
  and development of a ground-water inventory geospatial database will assist the
  United States Forest Service in better assessing the present and future impacts
  on ground-water resources within the Lake Tahoe Basin.\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
